import React, { useEffect, useRef, useState, useCallback } from 'react';
import { View, Animated, StyleSheet, Dimensions } from 'react-native';

const SNAKE_CONFIG = {
  SEGMENT_LENGTH: 37.5,
  BASE_LENGTH: 52,
  LENGTH: 35,
  BASE_SPEED: 6,
  MAX_TURNS: 3,
  LENGTH_VARIATION: 20,
  SPEED_VARIATION: 3,
  FPS: 30
};

const AnimatedLines = () => {
  const screenWidth = Dimensions.get('window').width;
  const screenHeight = Dimensions.get('window').height;
  const [snakes, setSnakes] = useState([]);
  const animationFrameRef = useRef();
  const lastUpdateTime = useRef(0);
  const frameDelay = 1000 / SNAKE_CONFIG.FPS;

  const createSnake = useCallback(() => ({
    id: Math.random(),
    dots: Array(SNAKE_CONFIG.BASE_LENGTH + Math.floor(Math.random() * SNAKE_CONFIG.LENGTH_VARIATION)).fill(0).map(() => ({
      x: new Animated.Value(-SNAKE_CONFIG.SEGMENT_LENGTH),
      y: new Animated.Value(0),
    })),
    direction: { x: 1, y: 0 },
    position: { x: -SNAKE_CONFIG.SEGMENT_LENGTH, y: Math.random() * screenHeight * 0.8 + screenHeight * 0.1 },
    path: [],
    turnsRemaining: SNAKE_CONFIG.MAX_TURNS,
    lastTurnX: -SNAKE_CONFIG.SEGMENT_LENGTH,
    speed: SNAKE_CONFIG.BASE_SPEED + (Math.random() * SNAKE_CONFIG.SPEED_VARIATION),
  }), [screenHeight]);

  // Initialize snakes
  useEffect(() => {
    const initialSnakes = [createSnake(), createSnake(), createSnake()];
    setSnakes(initialSnakes);
  }, [createSnake]);

  const moveSnakes = useCallback(() => {
    const currentTime = Date.now();
    if (currentTime - lastUpdateTime.current < frameDelay) {
      return; // Skip frame if not enough time has passed
    }

    lastUpdateTime.current = currentTime;

    setSnakes(current => 
      current.map(snake => {
        // Remove snakes that are off screen
        if (snake.position.x > screenWidth + SNAKE_CONFIG.SEGMENT_LENGTH) {
          return createSnake();
        }

        // Update head position
        snake.position.x += snake.direction.x * snake.speed;
        snake.position.y += snake.direction.y * snake.speed;

        // Store path point (reduce number of stored points)
        if (snake.path.length % 2 === 0) { // Store every other point
          snake.path.push({ ...snake.position });
        }
        while (snake.path.length > SNAKE_CONFIG.LENGTH) {
          snake.path.shift();
        }

        // Change direction less frequently
        const distanceSinceLastTurn = Math.abs(snake.position.x - snake.lastTurnX);
        if (snake.turnsRemaining > 0 && 
            distanceSinceLastTurn > SNAKE_CONFIG.SEGMENT_LENGTH * 8 &&
            Math.random() < 0.001) { // Reduced turn probability
          const directions = [
            { x: 1, y: 0 },
            { x: 0, y: 1 },
            { x: 0, y: -1 },
          ];
          const availableDirections = directions.filter(d => 
            d.x !== snake.direction.x || d.y !== snake.direction.y
          );
          snake.direction = availableDirections[Math.floor(Math.random() * availableDirections.length)];
          snake.turnsRemaining--;
          snake.lastTurnX = snake.position.x;
        }

        // Update dot positions less frequently
        snake.dots.forEach((dot, index) => {
          if (index % 2 === 0) { // Update every other dot
            const pathPoint = snake.path[Math.max(0, snake.path.length - 1 - index)] || snake.position;
            dot.x.setValue(pathPoint.x);
            dot.y.setValue(pathPoint.y);
          }
        });

        return snake;
      })
    );
  }, [createSnake, screenWidth]);

  // Animation loop
  useEffect(() => {
    let isActive = true;

    const animate = () => {
      if (!isActive) return;
      moveSnakes();
      animationFrameRef.current = requestAnimationFrame(animate);
    };

    animate();

    return () => {
      isActive = false;
      if (animationFrameRef.current) {
        cancelAnimationFrame(animationFrameRef.current);
      }
    };
  }, [moveSnakes]);

  return (
    <View style={styles.container}>
      {snakes.map((snake) => (
        <View key={snake.id}>
          {snake.dots.map((dot, index) => (
            <Animated.View
              key={index}
              style={[
                styles.dot,
                {
                  opacity: (SNAKE_CONFIG.LENGTH - index) / SNAKE_CONFIG.LENGTH * 0.5,
                  transform: [
                    { translateX: dot.x },
                    { translateY: dot.y }
                  ]
                },
              ]}
            />
          ))}
        </View>
      ))}
    </View>
  );
};

const styles = StyleSheet.create({
  container: {
    position: 'absolute',
    top: 0,
    left: 0,
    right: 0,
    bottom: 0,
    pointerEvents: 'none',
    zIndex: 1,
  },
  dot: {
    position: 'absolute',
    width: 4,
    height: 4,
    backgroundColor: '#F4E409',
    borderRadius: 2,
  },
});

export default AnimatedLines;
